	  function parseOntologyContent( content ){

	    ontologyMenu.append_bulletPoint("Reading ontology graph ... ");
	    var _loader = ontologyMenu.getLoadingFunction();
	    _loader(content, ontologyIdentifierFromURL, "noAlternativeNameYet");
	  }

